import{_ as e,c as t,o,ag as n}from"./chunks/framework.ByciF0Oj.js";const r="/error-1.png",i="/error-2.png",l="/error-2.1.png",g=JSON.parse('{"title":"常见的错误解决方案","description":"","frontmatter":{},"headers":[],"relativePath":"docs/start/questions.md","filePath":"docs/start/questions.md","lastUpdated":1739355454000}'),c={name:"docs/start/questions.md"};function s(d,a,p,h,m,u){return o(),t("div",null,a[0]||(a[0]=[n('<h1 id="常见的错误解决方案" tabindex="-1">常见的错误解决方案 <a class="header-anchor" href="#常见的错误解决方案" aria-label="Permalink to &quot;常见的错误解决方案&quot;">​</a></h1><blockquote><p>前言：如果仔细阅读过文档，这些问题都不会出现，所以请先阅读一遍文档再运行系统</p></blockquote><h3 id="maven-langchat构建失败" tabindex="-1">Maven: langchat构建失败 <a class="header-anchor" href="#maven-langchat构建失败" aria-label="Permalink to &quot;Maven: langchat构建失败&quot;">​</a></h3><blockquote><p>作为一个开发人员，这种问题实在不该出现</p></blockquote><p>请检查本地IDEA的maven配置：</p><ol><li>切换阿里国内源</li><li>切换本地电脑网络</li><li>使用VPN</li></ol><h3 id="consider-defining-a-bean-error-creating-bean" tabindex="-1">Consider defining a bean/Error creating bean... <a class="header-anchor" href="#consider-defining-a-bean-error-creating-bean" aria-label="Permalink to &quot;Consider defining a bean/Error creating bean...&quot;">​</a></h3><p>此错误是因为没有修改<code>application.yml</code>中环境为<code>dev</code>，也就是没有读取到SpringBoot的<code>application-dev.yml</code>文件，默认读取<code>-local</code>文件</p><p><img src="'+r+'" alt="" loading="lazy"></p><h3 id="error-invalid-content-type-text-html-charset-utf-8" tabindex="-1">Error: Invalid content-type: text/html; charset=utf-8 <a class="header-anchor" href="#error-invalid-content-type-text-html-charset-utf-8" aria-label="Permalink to &quot;Error: Invalid content-type: text/html; charset=utf-8&quot;">​</a></h3><p>此错误一般都是因为<strong>配置模型使用了第三方代理</strong>产生的。一般情况第三方代理会提示修改baseUrl为xxxx.xx域名，但是其实还需要增加<code>/v1</code>后缀</p><p><img src="'+i+'" alt="" loading="lazy"></p><p>修改后模型的BaseUrl配置应该是这样的：</p><p><img src="'+l+'" alt="" loading="lazy"></p><h3 id="没有匹配到模型" tabindex="-1">没有匹配到模型 <a class="header-anchor" href="#没有匹配到模型" aria-label="Permalink to &quot;没有匹配到模型&quot;">​</a></h3><p>以及类似的错误，产生是因为后台没有配置模型信息。或者是模型信息填写的有错误导致模型配置加载失败</p><h3 id="invalid-content-type-application-json" tabindex="-1">Invalid content-type: application/json <a class="header-anchor" href="#invalid-content-type-application-json" aria-label="Permalink to &quot;Invalid content-type: application/json&quot;">​</a></h3><p>正常情况下我们的聊天都是sse类型流式接口，出现此错误的原因一般是因为模型接口返回是其他的错误消息，而非标准的json类型。</p><p>这种情况需要检查后台日志，出现这种情况的可能：</p><ol><li>apikey无效</li><li>认证失败</li><li>apiKey调用受限制</li><li>模型没有开通收费，不允许调用</li><li>...</li></ol>',20)]))}const b=e(c,[["render",s]]);export{g as __pageData,b as default};
